import{_ as e,a,b as r}from"./chunks/pinmap_bottom.B5byofUn.js";import{_ as l,c as o,a8 as i,o as s}from"./chunks/framework.BDnHobkS.js";const M=JSON.parse('{"title":"ThePeach FCC-K1","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/thepeach_k1.md","filePath":"ko/flight_controller/thepeach_k1.md"}'),d={name:"ko/flight_controller/thepeach_k1.md"};function n(p,t,h,c,u,g){return s(),o("div",null,t[0]||(t[0]=[i('<h1 id="thepeach-fcc-k1" tabindex="-1">ThePeach FCC-K1 <a class="header-anchor" href="#thepeach-fcc-k1" aria-label="Permalink to &quot;ThePeach FCC-K1&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://thepeach.kr/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><strong>ThePeach FCC-K1</strong> is an advanced autopilot designed and manufactured in <strong>ThePeach</strong>.</p><p>It is based on the <strong>Pixhawk-project FMUv3</strong> open hardware design and runs <strong>PX4</strong> on <strong>Nuttx OS</strong>.</p><p><img src="'+e+'" alt="ThePeach FCC-K1"></p><h2 id="사양" tabindex="-1">사양 <a class="header-anchor" href="#사양" aria-label="Permalink to &quot;사양&quot;">​</a></h2><ul><li><p>Main 프로세서: STM32F427VIT6</p><ul><li>32bit ARM Cortex-M4, 168 MHz 256 KB RAM 2 MB Flash memory</li></ul></li><li><p>IO 프로세서: STM32F100C8T6</p><ul><li>ARM Cortex-M3, 32bit ARM Cortex-M3, 24 MHz, 8KB SRAM</li></ul></li><li><p>내장 센서 :</p><ul><li>가속도/자이로: ICM-20602</li><li>가속도/자이로스코프/지자기: MPU-9250</li><li>기압계: MS5611</li></ul></li><li><p>인터페이스</p><ul><li>8+5개의 PWM 출력 (IO 8개, FMU 5개)</li><li>Spektrum DSM / DSM2 / DSM-X Satellite 입력 호환</li><li>Futaba S.BUS 입출력 호환</li><li>PPM 합계 신호 입력</li><li>아날로그/PWM RSSI 입력</li><li>PWM Servo 출력</li><li>안전 스위치/LED</li><li>UART 포트 4개: TELEM1, TELEM2, GPS, SERIAL4</li><li>I2C 포트 2개</li><li>CAN 버스 1개</li><li>ADC 1개</li><li>배터리 하나의 전압 / 전류에 대한 아날로그 입력</li></ul></li><li><p>기계적 특성</p><ul><li>치수: 40.2 x 61.1 x 24.8 mm</li><li>중량: 65g</li></ul></li></ul><h2 id="커넥터" tabindex="-1">커넥터 <a class="header-anchor" href="#커넥터" aria-label="Permalink to &quot;커넥터&quot;">​</a></h2><p><img src="'+a+'" alt="pinmaptop"></p><p><img src="'+r+'" alt="pinmapbottom"></p><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>IO 프로세서 디버그</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (흐름 제어)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (흐름 제어)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>PX4IO</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>디버그 콘솔</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>TELEM4</td></tr></tbody></table><h2 id="정격-전압" tabindex="-1">정격 전압 <a class="header-anchor" href="#정격-전압" aria-label="Permalink to &quot;정격 전압&quot;">​</a></h2><p><strong>ThePeach FCC-K1</strong> can be double-redundant on the power supply if two power sources are supplied. The two power rails are: <strong>POWER</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>이러한 조건에서 전원은 아래의 순서대로 시스템에 전원을 공급하여야합니다.</p><ol><li>POWER 입력 (5V ~ 5.5V)</li><li>USB 입력(4.75V ~ 5.25V)</li></ol><p><strong>Absolute Maximum Ratings</strong></p><p>이러한 조건에서 모든 전원은 비행 컨트롤러에 영구적인 손상을 입힙니다.</p><ol><li>POWER 입력 (5.5V 초과)</li><li>USB 입력 (5.5V 초과)</li></ol><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><p>이 비행 컨트롤러용 PX4를 빌드하려면:</p><div class="language-jsx vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">jsx</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">make thepeach_k1_default</span></span></code></pre></div><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p>Order from <a href="http://thepeach.shop/" target="_blank" rel="noreferrer">ThePeach</a></p>',26)]))}const P=l(d,[["render",n]]);export{M as __pageData,P as default};
